import * as React from 'react';
import { useState } from 'react';

const Index: React.FC = () => {
  const [count, setCount] = useState<number>(0);

  return (
    <>
      <div>HOME</div>
      <div>Page View Count is:</div>
      {count}
    </>
  );
};

export default Index;
